import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return(
    <Router>
      <div>
        <Link to = "/">Home</Link>
        <Link to = "/about">About</Link>

        <Switch>
          <Route path = "/">
            <Home />
          </Route>
          <Route path = "/about">
            <About />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
export default App;

function Home() {
  return <h1>fdsa</h1>
}

function About(){
  return <h1>About</h1>;
}
